We need to convert 2 decagrams to milligrams. 

$$
\begin{aligned} 
2 \text{ decagrams } &= 2 \times 10 \times 100 \text{ milligrams } \\
&= 2,000 \text{ milligrams }
\end{aligned}
$$

Since there are 1,000 milligrams in 1 gram, there are $2,000/1,000=2$ grams in 2 decagrams. Since there are 1,000 milligrams in 1 gram, there are $2 \times 1,000 = 2,000$ milligrams in 2 decagrams. Thus, there are 2,000 1-milligram doses in one 2-decagram container. 

Action: Answer("C")
